import * as React from 'react';
import { Card } from '@material-ui/core';

import arcade from "../images/arcade.png";

const Immagini = () => {
        return (
            <>  
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid"}} imgSrc="../images/arcade.png">
            </Card>
            </>
        );
}
 
export default Immagini;
